import React, { Component } from "react";
import { Card } from "react-bootstrap";

class Cart extends Component {
  render() {
    return (
      <Card border="info">
        <Card.Header> Welcome to the Piped Piper store !</Card.Header>
        <Card.Body></Card.Body>
      </Card>
    );
  }
}

export default Cart;
